import React from 'react'


const DataList = ({ name, image, symbol, price, volume, priceChange, marketcap }) => {
    return (
        <div className='coin-container'>
            <div className='coin-row'>
                <div className='coin'>
                    <img src={image} alt="crypto" />
                    <h1>{name}</h1>
                    <p className='coin-symbol'>{symbol}</p>
                </div>
                <div className='coin-data'>
                    <p className='coin-price'>${price}</p>
                    <p className='coin-volume'>${volume.toLocaleString()}</p>
                    {priceChange < 0 ? (
                        <p className='coin-change red'>{priceChange.toFixed(2)}%</p>
                    ) : (
                        <p className='coin-change green'>{priceChange.toFixed(2)}%</p>
                    )}
                    <p className='coin-marketcap'>
                        Pazar DeÄŸeri: ${marketcap.toLocaleString()} 
                    </p>
                </div>
            </div>
        </div>
    );
};

export default DataList
